package httpsTest;

import java.io.IOException;
import java.security.SecureRandom;

import javax.net.ssl.SSLContext;
import javax.net.ssl.TrustManager;
import javax.net.ssl.X509TrustManager;

import org.apache.http.Consts;
import org.apache.http.Header;
import org.apache.http.HttpResponse;
import org.apache.http.client.config.RequestConfig;
import org.apache.http.client.methods.HttpPost;
import org.apache.http.config.ConnectionConfig;
import org.apache.http.config.Registry;
import org.apache.http.config.RegistryBuilder;
import org.apache.http.conn.HttpClientConnectionManager;
import org.apache.http.conn.socket.ConnectionSocketFactory;
import org.apache.http.conn.socket.PlainConnectionSocketFactory;
import org.apache.http.conn.ssl.SSLConnectionSocketFactory;
import org.apache.http.entity.StringEntity;
import org.apache.http.impl.client.CloseableHttpClient;
import org.apache.http.impl.client.HttpClients;
import org.apache.http.impl.conn.BasicHttpClientConnectionManager;
import org.apache.http.impl.conn.PoolingHttpClientConnectionManager;

public class HttpsTestApp {

    public static void main(String[] args) throws IOException, Exception {
        String url = "https://eps-charter.nuancemobility.net/conversions/charter-us-voicemail";

        SSLContext context = SSLContext.getInstance("TLS");
        context.init(null, new TrustManager[] { trustManager }, new SecureRandom());
        SSLConnectionSocketFactory socketFactory = new SSLConnectionSocketFactory(context, SSLConnectionSocketFactory.ALLOW_ALL_HOSTNAME_VERIFIER);

        Registry<ConnectionSocketFactory> socketFactoryRegistry = RegistryBuilder.<ConnectionSocketFactory>create().register("https", socketFactory)
                .register("http", new PlainConnectionSocketFactory()).build();

        PoolingHttpClientConnectionManager connManager = new PoolingHttpClientConnectionManager(socketFactoryRegistry);

        ConnectionConfig connectionConfig = ConnectionConfig.custom().setCharset(Consts.UTF_8).build();

        RequestConfig requestConfig = RequestConfig.custom().setConnectTimeout(20000).build();

        CloseableHttpClient client = HttpClients.custom().setDefaultConnectionConfig(connectionConfig).setDefaultRequestConfig(requestConfig)
                .setConnectionManager(connManager).build();

        HttpPost postRequest = new HttpPost(url);
        postRequest.addHeader("X-Caller", "3038950928");
        // Called ID
        postRequest.addHeader("X-Called", "7753846647");
        // Reference ID : Charter Unique ID
        postRequest.addHeader("X-Reference", "1108612698217");
        // Return URL : RVM addTranscribed Message
        postRequest.addHeader("X-Return-URL", "https://rvmpwmpsint.prd-aws.charter.net/pomrvmedge/vmt/addTranscribedMessage");
        postRequest.addHeader("X-Reporting-Customer-Category", "RESIDENTIAL");

        postRequest.addHeader("Content-Type", "audio/wav");
        postRequest.addHeader("Content-Transfer-Encoding", "base64");
        
        StringEntity entity = new StringEntity("");
        entity.setContentType("application/json");
        postRequest.setEntity(entity);
        
        HttpResponse response = client.execute(postRequest);

        logHeaders(response);
    }

    private static void logHeaders(HttpResponse response) {
        System.out.println("NetworkUtils -logHeaders(+)");
        Header[] headers = response.getAllHeaders();
        for (Header header : headers) {
            System.out.println("Network Utils -logHeaders:" + " header " + header.getName() + " : " + header.getValue());
        }
    }

    private static CloseableHttpClient returnHttpsClient() throws Exception {
        // Now put the trust manager into an SSLContext.
        // Supported: SSL, SSLv2, SSLv3, TLS, TLSv1, TLSv1.1
        SSLContext sslContext = SSLContext.getInstance("TLS");

        sslContext.init(null, new TrustManager[] { trustManager }, new SecureRandom());

        // Use the above SSLContext to create your socket factory
        // Accept any hostname, so the self-signed certificates don't fail
        SSLConnectionSocketFactory socketFactory = new SSLConnectionSocketFactory(sslContext, SSLConnectionSocketFactory.ALLOW_ALL_HOSTNAME_VERIFIER);

        // apache HttpClient version >4.2 should use
        // BasicClientConnectionManager
        HttpClientConnectionManager connManager = new BasicHttpClientConnectionManager(RegistryBuilder.<ConnectionSocketFactory>create()
                .register("https", socketFactory).register("http", new PlainConnectionSocketFactory()).build());

        RequestConfig requestConfig = RequestConfig.custom().setConnectTimeout(20000).build();

        CloseableHttpClient httpClient = HttpClients.custom().setConnectionManager(connManager).setDefaultRequestConfig(requestConfig).build();

        return httpClient;
    }

    private static X509TrustManager trustManager = new X509TrustManager() {
        @Override
        public java.security.cert.X509Certificate[] getAcceptedIssuers() {
            // Don't do anything.
            return null;
        }

        @Override
        public void checkClientTrusted(java.security.cert.X509Certificate[] chain, String authType) throws java.security.cert.CertificateException {
        }

        @Override
        public void checkServerTrusted(java.security.cert.X509Certificate[] chain, String authType) throws java.security.cert.CertificateException {

        }
    };

}
